import styled from "styled-components"
import { Latest_newVideo } from "../data"
import {Link} from "react-router-dom"
const Container=styled.div`

`
const Wrapper=styled.div`
width: 70%;
margin: auto;
box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;

`;
const Heading=styled.div`
display: flex;
justify-content: space-between;
padding: 10px;

`
const Content=styled.p`
    color: black;

`
const CardDiv=styled.div`

`
const Image=styled.img`
   width :200px ;
   height :200px ;
`


const Card = () => {
  return (
    <Container>
        <Wrapper>
            <Heading>
                <Content><Link to={"/"}
                style={{
                    color:"black",
                    textDecoration:"none",
                    color: "#6e7174",

                }}
                >Latest News &amp; Videos</Link></Content>
                <Content><Link to={"/"}
                style={{
                    color:"#2c87fa",
                    textDecoration:"none"
                }}
                >Save Lives with Your Blog </Link></Content>
                <Content><Link to={"/"}
                style={{
                    color:"#2c87fa",
                    textDecoration:"none"
                }}

                >News &amp; Articles </Link></Content>
                <Content><Link to={"/"}
                style={{
                    color:"#2c87fa",
                    textDecoration:"none"
                }}
                > Follow Our Facebook</Link></Content>
            </Heading>
            <CardDiv>
                {Latest_newVideo.map((item)=>
                    <Image src={item.img} key={item.id}/>
                )}
            </CardDiv>
        </Wrapper>
    </Container>
  )
}

export default Card
